        "bibEntry": "<div class=\"csl-entry\">Colburn, A., Cohen, M. F., and Drucker, S. (2000). The role of eye gaze in avatar mediated conversational interfaces. <i>Sketches and Applications, Siggraphâ\u0080\u009900</i>.</div>",
