        "bibEntry": "<div class=\"csl-entry\">Wang, J., Drucker, S. M., Agrawala, M., and Cohen, M. F. (2006). The cartoon animation filter. In <i>ACM Transactions on Graphics (TOG)</i> (Vol. 25, pp. 1169â\u0080\u00931173). ACM.</div>",
